import React from 'react'
import image from './Images/loginicon.png'
function Dashboard() {
  return (
    <>
    <div class="d-flex justify-content-center align-items-center">
      <div>
        <img src={image} alt=""></img>
      </div>
    </div>
    </>
  )
}

export default Dashboard;
